public void dialogClosed(xFormRun _formRun)
{
    str phoneNumber,firstName,lastName;
    Object formRunObject;
    super(_formRun);
    if(_formRun.closedOk())
    {
        formRunObject = _formRun;
        [firstName,lastName,phoneNumber] = formRunObject.getValue();
        if(phoneNumber || firstName || lastName)
        {
            HMPatientChartClass::filterPatient(CustTable_1_ds,firstName,lastName,phoneNumber);
        }

        CustTable_1_ds.executeQuery();
    }
}

void clicked()
{
    super();
    CustTable_1_ds.queryBuildDataSource().clearRanges();
    if(CustTable_1_ds.query().dataSourceTable(tableNum(DirPersonName)) != null)
    {
        CustTable_1_ds.query().dataSourceTable(tableNum(DirPersonName)).clearRanges();
        CustTable_1_ds.query().dataSourceTable(tableNum(DirPersonName)).enabled(false);
    }
    if(CustTable_1_ds.query().dataSourceTable(tableNum(DirPerson)) != null)
    {
        CustTable_1_ds.query().dataSourceTable(tableNum(DirPerson)).enabled(false);
    }

    CustTable_1_ds.executeQuery();
}
